import React from 'react'; 

import '../styles/Cover.css'; 

const FoundationsCover = (props) => {
    return (
        <React.Fragment>
            <div className="foundations-cover-container">
                <span>Workshop 1:</span>
                <h1>Foundations</h1>
            </div>                

            <p className="workshop-desc">
                This course seeks to teach students the basics of fading, scissor work, and beard work. 
                The Foundations course will consist of a two-day workshop followed by a three month mentorship 
                period in which students can book private sessions with the mentors
            </p>

        </React.Fragment>
    )
}

export default FoundationsCover;
